\"实验\",\"答辩\"]'),(325,257,'','课程目标5',2,'培养学生的应用项目开发能力，通过对需求的理解，进行前端界面规划，视觉设计和用户交互设计。能够高效寻找与需求匹配的第三方界面框架，并能够根据自己的需求进行二次加工和调整。提升学生在应用开发过程中解决问题的能力，并形成自己的技术积累和项目经验储备。','通过应用开发指导，培养学生自学能力及解决问题的能力。','[\"2.2\"]','[\"作业\",\"实验\",\"答辩\"]'),(326,240,'','课程目标1',0.4,'使学生达到掌握程序设计基本理论及方法的知识目标；','通过讲授、演示、提问、实践操作等环节，让学生理解、掌握C语言程序设计的基本方法和步骤，熟悉C语言主要语法及编程技巧。','[\"3.4\"]','[\"考试\",\"作业\"]'),(327,240,'','课程目标2',0.4,'使学生达到实现在日常工作学习中运用计算思维分析和解决问题的素质目标。','通过讲授、演示、实践操作等环节，让学生认识和掌握如何使用程序设计的方法解决日常生活和学习中遇到的问题。','[\"4.4\",\"5.2\"]','[\"考试\",\"作业\"]'),(328,240,'','课程目标3',0.2,'使学生达到能够正确选择相关程序开发工具进行软件设计的能力目标。','能够针对复杂工程问题，选择与使用计算机科学与技术领域的恰当技术手段和现代工程工 具进行分析、计算和设计；','[\"5.2\",\"4.4\"]','[\"考试\",\"作业\",\"实验\"]'),(329,262,'深度学习','课程目标1',0.5,'知识：掌握单个神经元与逻辑回归的对应关系，以及前向全连通神经网络基本架构；理解深度神经网络的模块化思想；掌握深度学习在训练和测试阶段进行分别优化的技巧（如自适应学习率、正则化、Dropout等）；掌握卷积神经网络基本思想并学会灵活运用；理解和掌握词嵌入、自编码器、迁徙学习等无监督学习的基本原理；掌握结构化学习的基本概念、原理和框架，并结合循环神经网络进一步理解结构化学习的理念；了解和掌握深度强化学习的基本概念和方法。','讲授，实验编程实践，让学生理解机器学习模型基本原理，掌握机器学习方法，完成机器学习实验训练。\n\n讲授，实验编程实践，让学生理解深度学习基本原理，掌握深度学习工具，掌握Python等编程语言。\n\n','[\"1.1\"]','[\"考试\"]'),(330,262,'深度学习','课程目标2',0.25,'能力：能够熟练掌握深度学习开发工具（如TensorFlow）的框架，并能够基于深度神经网络设计和实现深度学习应用；能够根据卷积神经网络的3个属性灵活运用卷积神经网络到不同类型的机器学习任务；能够运用词嵌入、自编码器、迁徙学习等技术完成各类无监督学习的训练任务；能够运用循环神经网络完成训练机器翻译等结构化学习的任务。','讲授，实验编程实践，让学生理解深度学习基本原理，掌握深度学习工具，掌握Python等编程语言。\n\n','[\"1.2\"]','[\"实验\"]'),(331,262,'深度学习','课程目标3',0.25,'素质：建立深度学习基于框架的商业软件开发观念，通过课程中的演示、交互、讨论培养表达、归纳、分析、沟通、交流等素质，通过课程学习及课程项目建立深度学习技术到应用的思维模式，提升理解工程管理与经济决策的基本素质。通过课外导学的模式，提升自主学习和终身学习的意识，形成不断学习和适应发展素质。','讲授，实验编程实践，让学生理解深度学习关于损失函数、正则化的基本理论，掌握深度学习基本思想和方法，能够设计实现深度学习算法。\n\n实验，让学生能查找文献。','[\"1.3\"]','[\"实验\"]'),(332,263,'','课程目标1',0.5,'1.	深度学习分类。\n2.	深度学习方法。\n3.	深度学习模型基本原理。','讲授，实验编程实践，让学生理解机器学习模型基本原理，掌握机器学习方法，完成机器学习实验训练。','[\"1.1\"]','[\"考试\"]'),(333,263,'','课程目标2',0.25,'1.	理解深度学习基本原理\n2.	熟悉各种软件工具\n3.	能够使用编程工具\n','讲授，实验编程实践，让学生理解深度学习基本原理，掌握深度学习工具，掌握Python等编程语言。','[\"1.2\"]','[\"实验\"]'),(334,263,'','课程目标3',0.25,'.理解卷积神经网络和循环神经网络，理解词嵌入\n2.理解各种损失函数\n3.理解深度学习实质\n','讲授，实验编程实践，让学生理解深度学习关于损失函数、正则化的基本理论，掌握深