用于理解、描述和解决复杂工程问题。\n\n','[]','[\"考试\",\"作业\"]'),(365,268,'','课程目标4',0.05,'结合工程实践，理解离散数学在计算机学科各分支中的具体应用，及时了解离散数学相关领域的新技术与发展趋势，以及中国在该领域的最新成果。\n','通过课堂讲授、课堂讨论、文献查阅等形式，让学生对离散数学相关领域的新技术与发展趋势有所了解。\n','[\"6.1\"]','[\"考试\",\"作业\"]'),(366,268,'','课程目标5',0.05,'培养学生自主学习能力，提升对技术问题的理解能力，锻炼学生提出问题、分析问题、解决问题的能力，以适应计算机科学与技术领域新发展。\n\n','通过混合式教学、翻转课堂等形式，培养学生自学能力及解决问题的能力。\n\n','[\"12.2\"]','[\"考试\",\"作业\"]'),(367,269,'面向对象程序设计','课程目标1',0.1,'针对一个复杂系统或者过程选择恰当的数学模型，对模型正确性进行严谨的推理，并能正确求解。','通过讲授、演示、提问、设计、编程、实践操作、翻转课堂、项目驱动等方式，让学生理解、掌握、泛型和多线程。','[\"1.2\"]','[\"考试\"]'),(368,269,'面向对象程序设计','课程目标2',0.3,'掌握计算机科学与技术领域工程分析的基本方法，能认识到解决问题有多种方案可选择，并通过文献研究寻求适合的解决方案。','通过讲授、演示、提问、设计、编程、实践操作、翻转课堂、项目驱动等方式，让学生理解和掌握面向对象程序设计语言的数据类型、表达式、语句、类的定义、对象的创建方法、类的继承、多态、抽象类的定义方法和接口的定义方法，数组的定义和使用，输入/输出流的使用，泛型，多线程和数据库访问的知识。','[\"2.3\"]','[\"考试\"]'),(369,269,'面向对象程序设计','课程目标3',0.5,'掌握计算机科学与技术领域工程设计和产品开发全周期、全流程的基本设计/开发方法和技术，了解影响设计目标和技术方案的各种因素。','通过讲授、演示、提问、设计、编程、实践操作、翻转课堂、项目驱动等方式，让学生理解和掌握面向对象程序设计语言的数据类型、表达式、语句、类的定义、对象的创建方法、类的继承、多态、抽象类的定义方法和接口的定义方法，数组的定义和使用，输入/输出流的使用，泛型，多线程和数据库访问的知识。','[\"3.1\"]','[\"考试\",\"实验\"]'),(370,269,'面向对象程序设计','课程目标4',0.1,'具有自主学习的能力，包括对技术问题的理解能力，归纳总结能力和提出问题的能力，适应计算机科学与技术领域发展。','通过讲授、演示、提问、设计、编程、实践操作、翻转课堂、项目驱动等方式，让学生理解和掌握使用面向对象程序设计语言解决问题、项目开发的能力。','[\"12.2\"]','[\"考试\"]'),(371,270,'Web程序设计实习','课程目标1',2,'能够根据需求进行功能设计和界面规划，进而完成用户交互设计。熟练使用HTML常见标签构建静态内容，熟练利用IDE工具进行调试分析。','通过教学讲解、课后练习、课堂互动等手段，帮助学生培养逻辑思维能力和计算机思维。','[\"1.1\"]','[\"答辩\",\"论文\"]'),(372,270,'Web程序设计实习','课程目标2',2,'培养对样式的理解，能够熟练进行样式的查看、调试、修改。能够按照自己的设计思路完成样式设计。学会高效的获取第三方样式，并能够生成导出自己的样式模版。','以启发式、研讨式教学方法为主，通过课堂讲解、案例分析、课堂讨论、等诸多教学手段，培养学生的逻辑思维','[\"2.2\"]','[\"答辩\",\"论文\"]'),(373,270,'','课程目标3',2,'培养学生前端编程技能，解决前端复杂的逻辑处理和界面交互问题的能力。通过对前端编程框架的系统学习，能够举一反三，针对特定需求能够找到适合的第三方函数库，学习相关文档手册，并能够通过自学解决实际应用中的问题。','灵活运用传授式、引导式和启发式等教学方法，通过重点/难点内容讲解、课后作业、布置学生文献查阅、进行课堂互动等模式，帮助学生掌握前端设计的基本知识，并能够将这些知识用于理解、描述和解决复杂工程问题。','[\"3.1\"]','[\"答辩\",\"论文\"]'),(374,270,'','课程目标4',2,'理解前端与服务器端通信过程的原理，熟练进行通信过程调试，数据格式设定，通信参数设定。理解通信过程中的异步与多线程机制，以及回调函数的使用。','通过课堂讲授、课堂讨论、应用开发指导等形式，让学生对课程设计相关领域的新技术与发展趋势有所了解。','[\"2.2\"]','[\"答辩\",\"论文\"]'),(375,270,'','课程目标5',2,'培养学生的应用项目开发能力，通过对需求的理解，进行前端界面规划，视觉设计和用户交互设计。能够高效寻找与需求匹配的第三方界面框架，并能够根据自己的需求进行二次加工和调整。提升学生在应用开发过程中解决问题的能力，并形成自己的技术积累和项目经验储备。','通过应用开发指导，培养学生自学能力及解决问题的能力。','[\"6.1\"]','[\"答辩\",\"论文\"]');
